import React from "react";
// import { useState } from "react";
import addition from "./addition";
import subtraction from "./subtraction";
import multiplication from "./multiplication";
import division from "./division";

function Calculator() {
  // const addition = () => {};
  // const subtraction = () => {};
  // const multiplication = () => {};
  // const division = () => {};

  // const [value, setvalue]=useState("value");
  return (
    <div className="border-8 justify-centre h-100% w-40 bg-black">
      <addition></addition>
      <subtraction></subtraction>
      <multiplication></multiplication>
      <division></division>
      <div className="border-4"></div>

      <table className="table-auto ">
        <input type="input"></input>
        <div className="display-flex px-4 py-3 h-50% w-80% text-20px">
          <button className="margin-auto">AC</button>
          <button>+/-</button>
          <button>%</button>
          <button onClick={division}>/</button>
        </div>
        <div>
          <button>7</button>
          <button>8</button>
          <button>9</button>
          <button onClick={multiplication}>x</button>
        </div>
        <div>
          <button>4</button>
          <button>5</button>
          <button>6</button>
          <button onClick={subtraction}>-</button>
        </div>
        <div>
          <button>1</button>
          <button>2</button>
          <button>3</button>
          <button onClick={addition}>+</button>
        </div>
        <div>
          <button colSpan={2}>0</button>
          <button>.</button>
          <button>=</button>
        </div>
      </table>
    </div>
  );
}
export default Calculator;
